import { apolloClient } from "../components/ApolloClient";
import { gql } from "@apollo/client";

export const fetchCurrencies = () => {
  return  apolloClient.query({
    query: gql`
        query Currencies {
            currencies {
                label
                symbol
            }
        }
    `
  });
}
